DROP TABLE IF EXISTS `auth_menu`;
CREATE TABLE `auth_menu` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `syscode` tinyint(2) DEFAULT NULL COMMENT '系统编号：1-EE快聘；2-精英易；3-聘得易；',
  `title` varchar(60) NOT NULL COMMENT '标题',
  `url` varchar(300) DEFAULT NULL COMMENT 'URL地址',
  `link_urls` varchar(1000) DEFAULT NULL COMMENT '相关url，授权后相关联URL也有效',
  `type` tinyint(1) NOT NULL DEFAULT '1' COMMENT '类型：1-菜单；2-功能；',
  `parent_id` int(11) NOT NULL DEFAULT '0' COMMENT '上级ID',
  `parent_path` varchar(30) NOT NULL COMMENT '父级菜单id路径，逗号分隔',
  `level` int(11) NOT NULL DEFAULT '1' COMMENT '级别',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态：1表示启用；2表示禁用；',
  `seq` int(11) NOT NULL DEFAULT '100',
  `remark` varchar(900) DEFAULT NULL COMMENT '备注',
  `del` tinyint(1) NOT NULL DEFAULT '0' COMMENT '删除：1表示删除；0表示未删除；',
  `create_user_id` varchar(32) NOT NULL COMMENT '创建人',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_user_id` varchar(32) NOT NULL COMMENT ' 更新人',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=162 DEFAULT CHARSET=utf8;

