INSERT INTO `blog_note` VALUES ('36', '43', '继承', '继承是面向对象中一个非常重要的特征。指的是：子类继承父类的属性和方法。\r\n我们可以通过继承的方式, 在父类的属性和方法基础上, 让子类也拥有这些属性和方法, 并可以扩展。', , '继承，面向对象', '2', '1', '2018-12-11 12:15:42', '1', '2018-12-11 14:42:48');

